import { FC } from 'react';
import Link from 'next/link';
import { StarFilled } from '@ant-design/icons';

interface P {
  repo: {
    login: string;
    name: string;
    full_name: string;
    description: string;
    license: {
      name: string;
    };
    updated_at: Date;
    language: string;
    stargazers_count: number;
  };
}

const Repo: FC<P> = ({ repo }) => {
  const {
    login,
    name,
    description,
    license,
    updated_at,
    language,
    stargazers_count,
  } = repo;
  return (
    <div>
      <div className="repo-info">
        <h3 className="repo-title">
          <Link href={`/detail?owner=${login}&name=${name}`}>
            <a>{name}</a>
          </Link>
        </h3>
        <div className="repo-desc">{description}</div>
        <div className="repo-other">
          <span className="language">{language}</span>
          <span className="license">{license.name}</span>
          <span className="stars">
            <StarFilled />
            {stargazers_count}
          </span>
          <span className="last-updated">{updated_at}</span>
        </div>
      </div>
      <style jsx>
        {`
          .repo-info {
            border-bottom: 1px solid #ccc;
            margin-bottom: 20px;
            padding-bottom: 20px;
          }
          .repo-title {
            font-size: 20px;
          }
          .repo-desc {
            width: 400px;
          }
          .repo-other {
            font-size: 12px;
            display: flex;
          }
          .repo-other span {
            margin-right: 15px;
          }
        `}
      </style>
    </div>
  );
};

export default Repo;
